import React from "react"

export default function Card({name, onRemove}){
    return (
        <div 
                style={{
                  color:"red", 
                  padding:10, 
                  border: "1px solid grey",
                  marginBottom:10,
                  display: "flex",
                  justifyContent: "space-between",
                  width:"50%",
                  borderRadius:"20px",
                  }}>
                <div>{name}</div>
                <button onClick={onRemove} className="button-remove">
                    Remove
                </button>
        </div>
    );
}
